                "displayText": "My name is Brett Soderholm and I am a fire weather forecaster for the Prince George Fire Centre. Today I'm actually on site at the North Peace Complex and the weather of course up here in the north is extremely variable from one day to the next. This morning, for example, started off very cool and humid, but now just a couple of hours later, the sun has come out. It's really quite hot and quite dry. The concern for these next couple of days is going to be for the chance of thunderstorms developing in the area. There's a lot of instability in the atmosphere and the concern from a wildfire perspective is that these thunderstorms may generate some lightning in addition to some gusty winds.",
